import React from 'react';
import './index.css';

const Jobs = (pr) => {
  console.log("Received Job:", allJobs); // Debugging line


  return (
    <div className="jobs-container">
      <h1 className="jobs-header">Available Job Listings</h1>
      <div className="jobs-list">
        <div key={allJobs.id} className="job-card">
          <div className="job-header">
            <h2 className="job-title">{allJobs.title}</h2>
            <span className="job-salary">{allJobs.salary}</span>
          </div>
          <h3 className="job-company">{allJobs.company}</h3>
          <div className="job-meta">
            <span className="job-location">üìç {allJobs.location}</span>
          </div>
          <p className="job-description">{allJobs.description}</p>
          <button className="apply-button">Apply Now</button>
        </div>
      </div>
    </div>
  );
};

export default Jobs;
